window.bookSummaryJSON = "Personal vendettas, hidden treasure, and a monkey named Carl will send bounty hunter Stephanie Plum on her most explosive adventure yet. <p><b>The Crime</b>: Armed robbery to the tune of nine million dollars</p> <p>Dom Rizzi robbed a bank, stashed the money, and did the time. His family couldn't be more proud. He always was the smart one.</p> <p> <b>The Cousin</b>: Joe Morelli</p> <p>Joe Morelli, Dom Rizzi, and Dom's sister, Loretta, are cousins. Morelli is a cop, Rizzi robs banks, and Loretta is a single mother waiting tables at the firehouse. The all-American family.</p> <p><b>The Complications</b>: Murder, kidnapping, destruction of personal property, and acid reflux</p> <p>Less than a week after Dom's release from prison, Joe Morelli has shadowy figures breaking into his house and dying in his basement. He's getting threatening messages, Loretta is kidnapped, and Dom is missing.</p> <p><b>The Catastrophe</b>: Moonman</p> <p>Morelli hires Walter \"Mooner\" Dunphy, stoner and \"inventor\" turned crime fighter, to protect his house. Morelli can't afford a lot on a cop's salary, and Mooner will work for potatoes.</p> <p><b>The Cupcake</b>: Stephanie Plum</p> <p>Stephanie and Morelli have a long-standing relationship that involves sex, affection, and driving each other nuts. She's a bond enforcement agent with more luck than talent, and she's involved in this bank-robbery-gone-bad disaster from day one.</p> <p> <b>The Crisis</b>: A favor for Ranger</p> <p>Security expert Carlos Manoso, street name Ranger, has a job for Stephanie that will involve night work. Morelli has his own ideas regarding Stephanie's evening activities.</p> <p><b>The Conclusion</b>: Only the fearless should listen to <i>Fourteen</i>.</p> <p>Thrills, chills, and incontinence may result.</p>"; 
